import uuid

def u():
    return str(uuid.uuid4())

def html_schema(text: str):
    return [[text]]

def build_ad_section(ad_index: int, ad: dict):
    blocks = []

    # Section heading
    blocks.append({
        "uuid": u(),
        "type": "HEADING_2",
        "groupUuid": u(),
        "groupType": "HEADING_2",
        "payload": {"safeHTMLSchema": html_schema(f"–û–±—ä—è–≤–ª–µ–Ω–∏–µ #{ad_index + 1}")}
    })

    # Ad context
    header = ad.get("header", f"–û–±—ä—è–≤–ª–µ–Ω–∏–µ #{ad_index + 1}")
    link = ad.get("link", "")
    posting_date = ad.get("posting_date", "")

    lines = [f"<b>{header}</b>"]
    if posting_date:
        lines.append(f"–î–∞—Ç–∞: {posting_date}")
    if link:
        lines.append(f"–°—Å—ã–ª–∫–∞: {link}")

    blocks.append({
        "uuid": u(),
        "type": "TEXT",
        "groupUuid": u(),
        "groupType": "TEXT",
        "payload": {"safeHTMLSchema": html_schema("<br>".join(lines))}
    })

    # Q1
    mc_group = u()

    blocks.append({
        "uuid": u(),
        "type": "TITLE",
        "groupUuid": u(),
        "groupType": "QUESTION",
        "payload": {
            "isFolded": False,
            "safeHTMLSchema": html_schema("–ê–∫—Ç—É–∞–ª—å–Ω–æ –ª–∏ –æ–±—ä—è–≤–ª–µ–Ω–∏–µ?")
        }
    })

    opt_yes_uuid = u()
    opt_no_uuid = u()
    opt_other_uuid = u()

    blocks.append({
        "uuid": opt_yes_uuid,
        "type": "MULTIPLE_CHOICE_OPTION",
        "groupUuid": mc_group,
        "groupType": "MULTIPLE_CHOICE",
        "payload": {
            "index": 0, "isRequired": True, "isFirst": True, "isLast": False,
            "hasOtherOption": True, "text": "–û–±—ä—è–≤–ª–µ–Ω–∏–µ –∞–∫—Ç—É–∞–ª—å–Ω–æ"
        }
    })

    blocks.append({
        "uuid": opt_no_uuid,
        "type": "MULTIPLE_CHOICE_OPTION",
        "groupUuid": mc_group,
        "groupType": "MULTIPLE_CHOICE",
        "payload": {
            "index": 1, "isRequired": True, "isFirst": False, "isLast": False,
            "hasOtherOption": True, "text": "–û–±—ä—è–≤–ª–µ–Ω–∏–µ –Ω–µ –∞–∫—Ç—É–∞–ª—å–Ω–æ"
        }
    })

    blocks.append({
        "uuid": opt_other_uuid,
        "type": "MULTIPLE_CHOICE_OPTION",
        "groupUuid": mc_group,
        "groupType": "MULTIPLE_CHOICE",
        "payload": {
            "isOtherOption": True, "index": 2, "isRequired": True,
            "isFirst": False, "isLast": True, "hasOtherOption": True, "text": "Other"
        }
    })

    # Q2 (hidden)
    q2_title_uuid = u()
    q2_mc_group = u()

    blocks.append({
        "uuid": q2_title_uuid,
        "type": "TITLE",
        "groupUuid": u(),
        "groupType": "QUESTION",
        "payload": {
            "isFolded": False,
            "isHidden": True,
            "safeHTMLSchema": html_schema("–ß—Ç–æ —Å–ª—É—á–∏–ª–æ—Å—å —Å –∂–∏–≤–æ—Ç–Ω—ã–º?")
        }
    })

    follow_opts = [
        "–ü—Ä–∏—Å—Ç—Ä–æ–∏–ª–∏",
        "–û—Å—Ç–∞–≤–∏–ª–∏ —Å–µ–±–µ",
        "–£–º–µ—Ä–ª–æ",
        "–ü—Ä–æ—Ö–æ–¥–∏—Ç –ª–µ—á–µ–Ω–∏–µ / –∞–¥–∞–ø—Ç–∞—Ü–∏—é",
        "–í—ã–ø—É—Å—Ç–∏–ª–∏ –Ω–∞ —É–ª–∏—Ü—É",
    ]

    follow_opt_uuids = []
    for i, t in enumerate(follow_opts):
        ou = u()
        follow_opt_uuids.append(ou)
        blocks.append({
            "uuid": ou,
            "type": "MULTIPLE_CHOICE_OPTION",
            "groupUuid": q2_mc_group,
            "groupType": "MULTIPLE_CHOICE",
            "payload": {
                "index": i, "isRequired": True, "isFirst": (i == 0), "isLast": False,
                "hasOtherOption": True, "isHidden": True, "text": t
            }
        })

    follow_other_uuid = u()
    blocks.append({
        "uuid": follow_other_uuid,
        "type": "MULTIPLE_CHOICE_OPTION",
        "groupUuid": q2_mc_group,
        "groupType": "MULTIPLE_CHOICE",
        "payload": {
            "isOtherOption": True, "index": len(follow_opts), "isRequired": True,
            "isFirst": False, "isLast": True, "hasOtherOption": True,
            "isHidden": True, "text": "Other"
        }
    })

    # Conditional logic: if Q1 == "not –∞–∫—Ç—É–∞–ª—å–Ω–æ" => show Q2 blocks
    show_blocks = [q2_title_uuid] + follow_opt_uuids + [follow_other_uuid]

    blocks.append({
        "uuid": u(),
        "type": "CONDITIONAL_LOGIC",
        "groupUuid": u(),
        "groupType": "CONDITIONAL_LOGIC",
        "payload": {
            "updateUuid": u(),
            "logicalOperator": "AND",
            "conditionals": [
                {
                    "uuid": u(),
                    "type": "SINGLE",
                    "payload": {
                        "field": {
                            "uuid": mc_group,
                            "type": "INPUT_FIELD",
                            "questionType": "MULTIPLE_CHOICE",
                            "blockGroupUuid": mc_group,
                            "title": "–ê–∫—Ç—É–∞–ª—å–Ω–æ –ª–∏ –æ–±—ä—è–≤–ª–µ–Ω–∏–µ?"
                        },
                        "comparison": "IS",
                        "value": opt_no_uuid
                    }
                }
            ],
            "actions": [
                {
                    "uuid": u(),
                    "type": "SHOW_BLOCKS",
                    "payload": {"showBlocks": show_blocks}
                }
            ]
        }
    })

    return blocks


